  false,\n\t\"url\": null,\n\t\"notes\": \"From 1946 to the early 1980s, the 3-acre
  Eastern Surplus Superfund Site in Meddybemps, Maine, was used for the disposal and
  storage of surplus military equipment and salvage items. Meddybemps Lake is used
  by a federally listed threatened species, the bald eagle, and portions of the lake
  form the border of a National Wildlife Refuge. The Dennys River is a regionally
  important river for Atlantic salmon, a species of management concern to the U.S.
  Fish and Wildlife Service. Consequently, contaminants associated with the Eastern
  Surplus Site have been a concern to the residents of Meddybemps and to state and
  federal fish and wildlife agencies. In 1997, at the request of the Environmental
  Protection Agency, the U.S. Fish and Wildlife Service conducted a screening-level
  contaminant survey of fish and mussels of Meddybemps Lake, the Dennys River, and
  the East Machias River. The purposes of this survey were to determine if PCBs and
  other environmental contaminants were accumulating in aquatic biota, and to provide
  baseline data for human health and ecological risk assessments.\",\n\t\"owner_org\":
